description:
The Cougars are back and on the prowl for more hot young men in Volume 4 of Sweet Sinner's scorching older/younger series. Michelle Lay complains that her young lovers are getting too 'needy,' so she hooks up with cocky young stud Seth Gamble. But will Seth's cavalier attitude give her second thoughts about her empty love life? Meanwhile, real estate agent Roxanne Hall meets broken-hearted Xander Corvus while showing his parent's house to a client. When the sensitive young man confides his pain to the gorgeous older woman, will primal temptation get the better of her? Teri Weigel enlists superstud Manuel Ferrara to tutor her in French before her business trip abroad. But Teri decides to experience the hot Frenchman's native tongue in more ways than one. And Magdalene St. Michaels hires young Dane Cross to set up her home computer. But when the hapless young geek connects the wrong wires, an angry Magdalene decides to teach the young boy a lesson. Written and directed by Nica Noelle

Roxanne Hall, Magdalene St. Michaels, Teri Weigel, Michelle Lay, Manuel Ferrara, Dane Cross

